description:
For att overvinna styrkan av sina minnen, bevarar Ann Lord en val
bevarad hemlighet for sina dottrar, Constance, en gift kvinna och 
mamma, och Nina, en rastlos ensamstaende kvinna. Bada dottrarna
ar till sangs nar de hor mamman ropa efter den man hon alskade mer 
an nagon annan. Men vem var &quot;Harris&quot; undrar dottrarna och vad 
betydde han for deras mamma???
